// approach 1: Sort and add top 3 (lazy man's approach)
func part2a(inventories []ElfInventory) int { sort.Slice(inventories, func(i, j int) bool { return inventories[i].total > inventories[j].total }) return inventories[0].total + inventories[1].total + inventories[2].total
} // approach 2: Three linear scans
func part2b(inventories []ElfInventory) int { var top1 int = -1 var top2 int = -1 var top3 int = -1 var t1, t2 int for i, inv := range inventories { if inv.total > top1 { top1 = inv.total t1 = i } } for i, inv := range inventories { if i != t1 && inv.total > top2 { top2 = inv.total t2 = i } } for i, inv := range inventories { if i != t1 && i != t2 && inv.total > top3 { top3 = inv.total } } return top1 + top2 + top3
} // approach 3: Single linear scan
func part2c(inventories []ElfInventory) int { var top1 int = -1 var top2 int = -1 var top3 int = -1 for _, inv := range inventories { if inv.total > top1 { top3 = top2 top2 = top1 top1 = inv.total continue } if inv.total > top2 { top3 = top2 top2 = inv.total continue } if inv.total > top3 { top3 = inv.total } } return top1 + top2 + top3
}

